import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  padding: 2rem;
`;

const About = () => (
  <AboutContainer>
    <h2>Sobre a Pousada</h2>
    <p>
      A Pousada Pinheira está situada em uma das praias mais bonitas de Santa Catarina, oferecendo uma experiência única para nossos hóspedes.
    </p>
  </AboutContainer>
);

export default About;
